            'package' => $jobs['package'],
            'hide' => 1,
            'status' => 1
        ),
        'order' => 'softid desc',
        'field' => 'softid,package'        
    );
    $soft = $model->findOne($option);
    if(!$soft){
        writelog('软件不存在');
