        return false;
    }
    if(empty($jobs['time_rule'])){
        writelog('时间显示规则为空');
        return false;
    }
    
    $data = array(
        'sid' => $jobs['sid'],
        'admin_id' => $jobs['admin_id'],
        'softid' => $soft['softid'],
        'time_rule' => $jobs['time_rule'],
        'package' => $jobs['package'],
        'content' => $jobs['content'],
        'ip' => $jobs['ip']
    );
    
    $res = httpGetInfo($url,$data);
    $res = json_decode($res,true);
    if($res['code']!=200){
        writelog($res['fail_info']);   
        return false;
    }
}


