function comment_soft_http($data){
	$param = array(
		'KEY' => 'SOFT_COMMENT',
		'ID' => $data['softid'],
		'MAC' => $data['mac'],
		'COMMENT_CONTENT' => $data['content'],
		'SOFT_STAR' => $data['SOFT_STAR'],
		'CUSTOM' => 4401,
		'MT' => $data['rt'],
		'VR' => 1
	);
    writelog(json_encode($param));
	$res = gomarket_action('comment.GoPostComment',$param);
	return $res;
}

function gomarket_action($module_action, $parameters)
{
    load_library('GoService');
    list($module, $action) = explode('.', $module_action);
    $action_file = GO_APP_ROOT. DS. 'modules' . DS. strtolower($module). DS. $action. '.php';
    if (!file_exists($action_file)) {
        return False;
    }
    include_once $action_file;
    if (!class_exists($action)) {
        return False;
    }
    $actionClass = new $action;
    $actionClass->parameters = $parameters;
    return $actionClass->execute();
}
abstract class GoAction
{
    abstract public function execute();
    public function getParameter($key = null, $default = '')
    {
        $parameter = isset($this->parameters[$key])? $this->parameters[$key] : $default;
        return $parameter;
    }
}

function httpGetInfo($url, $vals) {
        $res = curl_init();
        curl_setopt($res, CURLOPT_URL, $url);
        curl_setopt($res, CURLOPT_POST, true);
        curl_setopt($res, CURLOPT_RETURNTRANSFER, true);
        curl_setopt($res, CURLOPT_POSTFIELDS, $vals);
        $result = curl_exec($res);
        $http_code = curl_getinfo($res, CURLINFO_HTTP_CODE);
        $errno = curl_errno($res);
        $error = curl_error($res);
        curl_close($res);
        $log = "{$http_code}|{$errno}|{$error}\n" . print_r($vals, true) . "\n" . print_r($result, true) . "\n\n";
        writelog($log);
        return $result;
}

function writelog($msg){
	$now = time();
	$path = "/data/att/permanent_log/admin_cron_log/".date("Y-m-d", $now);
	if(!file_exists($path)){
		mkdir($path, 0755, true);
	}	
	$path_log = $path."/comment_soft.log";
	$msg = date('Y-m-d H:i:s', $now). " {$msg}\n";
	file_put_contents($path_log, $msg, FILE_APPEND);
}